webpackJsonp([0xdf7f3ad08e10f80],{"./node_modules/json-loader/index.js!./.cache/json/git-git-pull.json":function(e,t){e.exports={data:{markdownRemark:{html:"<h2>Git Pull</h2>\n<p><code>git pull</code> is a Git command used to update the local version of a repository from a remote. </p>\n<p>It is one of the four commands that prompts network interaction by Git. By default, <code>git pull</code> does two things.</p>\n<ol>\n<li>Updates the current local working branch (currently checked out branch)</li>\n<li>Updates the remote tracking branches for all other branches.</li>\n</ol>\n<p><code>git pull</code> fetches (<code>git fetch</code>) the new commits and merges <a href='https://guide.freecodecamp.org/git/git-merge' target='_blank' rel='nofollow'>(<code>git merge</code>)</a> these into your local branch.</p>\n<p>This command’s syntax is as follows:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-shell\"><code># General format\ngit pull OPTIONS REPOSITORY REFSPEC\n\n# Pull from specific branch\ngit pull REMOTE-NAME BRANCH-NAME</code></pre>\n      </div>\n<p>in which:</p>\n<ul>\n<li><strong>OPTIONS</strong> are the command options, such as <code>--quiet</code> or <code>--verbose</code>. You can read more about the different options in the <a href='https://git-scm.com/docs/git-pull' target='_blank' rel='nofollow'>Git documentation</a></li>\n<li><strong>REPOSITORY</strong> is the URL to your repo. Example:  <a href=\"https://github.com/freeCodeCamp/freeCodeCamp.git\">https://github.com/freeCodeCamp/freeCodeCamp.git</a></li>\n<li><strong>REFSPEC</strong> specifies which refs to fetch and which local refs to update</li>\n<li><strong>REMOTE-NAME</strong> is the name of your remote repository. For example: <em>origin</em>.</li>\n<li><strong>BRANCH-NAME</strong> is the name of your branch. For example: <em>develop</em>.</li>\n</ul>\n<p><strong>Note</strong></p>\n<p>If you have uncommited changes, the merge part of the <code>git pull</code> command will fail and your local branch will be untouched. </p>\n<p>Thus, you should <em>always commit your changes in a branch before pulling</em> new commits from a remote repository.</p>\n<p><strong>Table of Contents</strong></p>\n<ul>\n<li><a href=\"#using-git-pull\">Using <code>git pull</code></a></li>\n<li><a href=\"#distributed-version-control\">Distributed Version Control</a></li>\n<li><a href=\"#git-fetch-plus-git-merge\"><code>git fetch</code> + <code>git merge</code></a></li>\n<li><a href=\"#git-pull-in-IDEs\"><code>git pull</code> in IDEs</a></li>\n</ul>\n<h3>Using git pull</h3>\n<p>Use <code>git pull</code> to update a local repository from the corresponding remote repository. Ex: While working locally on <code>master</code>, execute <code>git pull</code> to update the local copy of <code>master</code> and update the other remote tracking branches. (More information on remote tracking branches in the next section.) </p>\n<p>But, there are a few things to keep in mind for that example to be true: </p>\n<ul>\n<li>\n<p>The local repository has a linked remote repository</p>\n<ul>\n<li>Check this by executing <code>git remote -v</code></li>\n<li>If there are multiple remotes, <code>git pull</code> might not be enough information. You might need to enter <code>git pull origin</code> or <code>git pull upstream</code>. </li>\n</ul>\n</li>\n<li>\n<p>The branch you are currently checked out to has a corresponding remote tracking branch</p>\n<ul>\n<li>Check this by executing <code>git status</code>. If there is no remote tracking branch, Git doesn’t know where to pull information <em>from</em>. </li>\n</ul>\n</li>\n</ul>\n<h3>Distributed Version Control</h3>\n<p>Git is a <strong>Distributed Version Control System</strong> (DVCS). With DVCS, developers can be working on the same file at the same time in separate environments. After <em>pushing</em> code up to the shared remote repository, other developers can <em>pull</em> changed code.</p>\n<h4>Network interactions in Git</h4>\n<p>There are only four commands that prompt network interactions in Git. A local repository has no awareness of changes made on the remote repository until there is a request for information. And, a remote repository has no awareness of local changes until commits are pushed.</p>\n<p>The four network commands are:</p>\n<ul>\n<li><code>git clone</code></li>\n<li><code>git fetch</code></li>\n<li><code>git pull</code></li>\n<li><code>git push</code></li>\n</ul>\n<h4>Branches in DVCS</h4>\n<p>When working with Git, it can feel like there are lots of copies of the same code floating all over the place. There are different versions of the same file on each branch. And, different copies of the same branches on every developer’s computer and on the remote. To keep track of this, Git uses something called <strong>remote tracking branches</strong>. </p>\n<p>If you execute <code>git branch --all</code> within a Git repository, remote tracking branches appear in red. These are read only copies of the code as it appears on the remote. ( When was the last network interaction that would have brought information locally? Remember when this information was last updated. The information in the remote tracking branches reflects the information from that interaction.) </p>\n<p>With <strong>remote tracking branches</strong>, you can work in Git on several branches without network interaction.  Every time you execute <code>git pull</code> or <code>git fetch</code> commands, you update <strong>remote tracking branches</strong>.</p>\n<h3>git fetch plus git merge</h3>\n<p><code>git pull</code> is a combination command, equal to <code>git fetch</code> + <code>git merge</code>. </p>\n<h4>git fetch</h4>\n<p>On its own, <code>git fetch</code> updates all the remote tracking branches in local repository. No changes are actually reflected on any of the local working branches. </p>\n<h4>git merge</h4>\n<p>Without any arguments, <code>git merge</code> will merge the corresponding remote tracking branch to the local working branch. </p>\n<h4>git pull</h4>\n<p><code>git fetch</code> updates remote tracking branches. <code>git merge</code> updates the current branch with the corresponding remote tracking branch. Using <code>git pull</code>, you get both parts of these updates. But, this means that if you are checked out to <code>feature</code> branch and you execute <code>git pull</code>, when you checkout to <code>master</code>, any new updates will not be included. Whenever you checkout to another branch that may have new changes, it’s always a good idea to execute <code>git pull</code>. </p>\n<h3>git pull in IDEs</h3>\n<p>Common language in other IDES may not include the word <code>pull</code>. If you look out for the words <code>git pull</code> but don’t see them, look for the word <code>sync</code> instead. </p>\n<h3>fethcing a remote PR (Pull Request) in to local repo</h3>\n<p>For purposes of reviewing and such, PRs in remote should be fetched to the local repo. You can use <code>git fetch</code> command as follows to achieve this.</p>\n<p><code>git fetch origin pull/ID/head:BRANCHNAME</code></p>\n<p>ID is the pull request id and BRANCHNAME is the name of the branch that you want to create. Once the branch has been created you can use <code>git checkout</code> to switch to that brach.</p>\n<h3>Other Resources on git pull</h3>\n<ul>\n<li><a href='https://git-scm.com/docs/git-pull' target='_blank' rel='nofollow'>git-scm</a></li>\n<li><a href='https://help.github.com/articles/fetching-a-remote/#pull' target='_blank' rel='nofollow'>GitHub Help Docs</a></li>\n<li><a href='https://www.atlassian.com/git/tutorials/syncing' target='_blank' rel='nofollow'>Syncing Tutorials</a></li>\n</ul>\n<h3>Other Resources on git in guide.freecodecamp.org</h3>\n<ul>\n<li><a href=\"../git-merge/index.md\">Git merge</a></li>\n<li><a href=\"../git-checkout/index.md\">Git checkout</a></li>\n<li><a href=\"../git-commit/index.md\">Git commit</a></li>\n<li><a href=\"../git-stash/index.md\">Git stash</a></li>\n<li><a href=\"../git-branch/index.md\">Git branch</a></li>\n</ul>",fields:{slug:"/git/git-pull/"},frontmatter:{title:"Git Pull"}}},pathContext:{slug:"/git/git-pull/"}}}});
